('a40e0852-7733-ab26-5d0c-604dffead559',	'2021-03-14 12:21:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'Case Closure',	'Template for informing a contact that their case has been closed.',	'$acase_name [CASE:$acase_case_number] closed',	'Hi $contact_first_name $contact_last_name,\n\n					   Your case $acase_name (# $acase_case_number) has been closed on $acase_date_entered\n					   Status:				$acase_status\n					   Reference:			$acase_case_number\n					   Resolution:			$acase_resolution',	'<p> Hi $contact_first_name $contact_last_name,</p>\n					    <p>Your case $acase_name (# $acase_case_number) has been closed on $acase_date_entered</p>\n					    <table border=\"0\"><tbody><tr><td>Status</td><td>$acase_status</td></tr><tr><td>Reference</td><td>$acase_case_number</td></tr><tr><td>Resolution</td><td>$acase_resolution</td></tr></tbody></table>',	0,	NULL,	NULL,	'system'),
('a5ad4ca1-3d28-5e52-dd20-604dff13b11b',	'2021-03-14 12:21:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'Joomla Account Creation',	'Template used when informing a contact that they\'ve been given an account on the joomla portal.',	'Support Portal Account Created',	'Hi $contact_name,\n					   An account has been created for you at $portal_address.\n					   You may login using this email address and the password $joomla_pass',	'<p>Hi $contact_name,</p>\n					    <p>An account has been created for you at <a href=\"$portal_address\">$portal_address</a>.</p>\n					    <p>You may login using this email address and the password $joomla_pass</p>',	0,	NULL,	NULL,	'system'),
('a769ba89-6c75-8671-407c-604dffb07fdf',	'2021-03-14 12:21:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'Case Creation',	'Template to send to a contact when a case is received from them.',	'$acase_name [CASE:$acase_case_number]',	'Hi $contact_first_name $contact_last_name,\n\n					   We\'ve received your case $acase_name (# $acase_case_number) on $acase_date_entered\n					   Status:		$acase_status\n					   Reference:	$acase_case_number\n					   Description:	$acase_description',	'<p> Hi $contact_first_name $contact_last_name,</p>\n					    <p>We\'ve received your case $acase_name (# $acase_case_number) on $acase_date_entered</p>\n					    <table border=\"0\"><tbody><tr><td>Status</td><td>$acase_status</td></tr><tr><td>Reference</td><td>$acase_case_number</td></tr><tr><td>Description</td><td>$acase_description</td></tr></tbody></table>',	0,	NULL,	NULL,	'system'),
('ad6220ab-ba6d-17f3-cecf-604dff72db47',	'2021-03-14 12:21:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'Contact Case Update',	'Template to send to a contact when their case is updated.',	'$acase_name update [CASE:$acase_case_number]',	'Hi $user_first_name $user_last_name,\n\n					   You\'ve had an update to your case $acase_name (# $acase_case_number) on $aop_case_updates_date_entered:\n					       $contact_first_name $contact_last_name, said:\n					               $aop_case_updates_description',	'<p>Hi $contact_first_name $contact_last_name,</p>\n					    <p> </p>\n					    <p>You\'ve had an update to your case $acase_name (# $acase_case_number) on $aop_case_updates_date_entered:</p>\n					    <p><strong>$user_first_name $user_last_name said:</strong></p>\n					    <p style=\"padding-left:30px;\">$aop_case_updates_description</p>',	0,	NULL,	NULL,	'system'),
('af25fdaf-d3c9-ee90-69fd-604dff5cc6cd',	'2021-03-14 12:21:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'User Case Update',	'Email template to send to a SuiteCRM user when their case is updated.',	'$acase_name (# $acase_case_number) update',	'Hi $user_first_name $user_last_name,\n\n					   You\'ve had an update to your case $acase_name (# $acase_case_number) on $aop_case_updates_date_entered:\n					       $contact_first_name $contact_last_name, said:\n					               $aop_case_updates_description\n                        You may review this Case at:\n                            $sugarurl/index.php?module=Cases&action=DetailView&record=$acase_id;',	'<p>Hi $user_first_name $user_last_name,</p>\n					     <p> </p>\n					     <p>You\'ve had an update to your case $acase_name (# $acase_case_number) on $aop_case_updates_date_entered:</p>\n					     <p><strong>$contact_first_name $contact_last_name, said:</strong></p>\n					     <p style=\"padding-left:30px;\">$aop_case_updates_description</p>\n					     <p>You may review this Case at: $sugarurl/index.php?module=Cases&action=DetailView&record=$acase_id;</p>',	0,	NULL,	NULL,	'system'),
('b04de949-45d2-158a-b1db-604dffd23e0e',	'2021-03-14 12:21:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'System-generated password email',	'This template is used when the System Administrator sends a new password to a user.',	'New account information',	'\nHere is your account username and temporary password:\nUsername : $contact_user_user_name\nPassword : $contact_user_user_hash\n\n$config_site_url\n\nAfter you log in using the above password, you may be required to reset the password to one of your own choice.',	'<div><table width=\"550\"><tbody><tr><td><p>Here is your account username and temporary password:</p><p>Username : $contact_user_user_name </p><p>Password : $contact_user_user_hash </p><br /><p>$config_site_url</p><br /><p>After you log in using the above password, you may be required to reset the password to one of your own choice.</p>   </td>         </tr><tr><td></td>         </tr></tbody></table></div>',	0,	NULL,	0,	'system'),
('b1cad90d-6fc3-84f4-c953-604dff65aefa',	'2021-03-14 12:21:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'Forgot Password email',	'This template is used to send a user a link to click to reset the user\'s account password.',	'Reset your account password',	'\nYou recently requested on $contact_user_pwd_last_changed to be able to reset your account password.\n\nClick on the link below to reset your password:\n\n$contact_user_link_guid',	'<div><table width=\"550\"><tbody><tr><td><p>You recently requested on $contact_user_pwd_last_changed to be able to reset your account password. </p><p>Click on the link below to reset your password:</p><p> $contact_user_link_guid </p>  </td>         </tr><tr><td></td>         </tr></tbody></table></div>',	0,	NULL,	0,	'system'),
('b39dc0b0-500e-e305-f06a-604dffb85aed',	'2021-03-14 12:21:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'Two Factor Authentication email',	'This template is used to send a user a code for Two Factor Authentication.',	'Two Factor Authentication Code',	'Two Factor Authentication code is $code.',	'<div><table width=\"550\"><tbody><tr><td><p>Two Factor Authentication code is <b>$code</b>.</p>  </td>         </tr><tr><td></td>         </tr></tbody></table></div>',	0,	NULL,	0,	'system'),
('b7cc7429-bb54-4fb8-8fc8-604dff49983d',	'2013-05-24 14:31:45',	'2021-03-14 12:21:45',	'1',	'1',	'off',	'Event Invite Template',	'Default event invite template.',	'You have been invited to $fp_events_name',	'Dear $contact_name,\nYou have been invited to $fp_events_name on $fp_events_date_start to $fp_events_date_end\n$fp_events_description\nYours Sincerely,\n',	'\n<p>Dear $contact_name,</p>\n<p>You have been invited to $fp_events_name on $fp_events_date_start to $fp_events_date_end</p>\n<p>$fp_events_description</p>\n<p>If you would like to accept this invititation please click accept.</p>\n<p> $fp_events_link or $fp_events_link_declined</p>\n<p>Yours Sincerely,</p>\n',	0,	NULL,	NULL,	'system');
